window.bookSummaryJSON = "<p>Martha Wells' <i>New York Times</i> and<i> USA Today</i> best-selling Murderbot series exploded onto the scene in 2017, and the world has not been the same, since.</p> <p>Murderbot returns in its highly anticipated, first full-length stand-alone novel, <i>Network Effect</i>.</p> <p>You know that feeling when you’re at work and you’ve had enough of people, and then the boss walks in with yet another job that needs to be done right this second or the world will end, but all you want to do is go home and binge your favorite shows? And you're a sentient murder machine programmed for destruction? Congratulations, you're Murderbot.</p> <p>Come for the pew-pew space battles, stay for the most relatable AI you’ll listen to this century.</p> <p>I’m usually alone in my head, and that’s where 90-plus percent of my problems are.</p> <p>When Murderbot's human associates (not friends, never friends) are captured and another not-friend from its past requires urgent assistance, Murderbot must choose between inertia and drastic action.</p> <p>Drastic action it is, then.</p>"; 
